import React from 'react'
import {contactPage} from '../../../constants/constants';

function postCabin() {
    const options = {
      method: 'POST',
      headers : {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(contactPage)

    }
    fetch('/cabins', options)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  };

  export default function (props) {
    return (
      <>
        <p>Hello from Admin</p>
        <button onclick={postCabin()}>Post a cabin</button>
      </>
    )
  }
